(1, '2016-05-13 00:08:27', '2017-10-06 01:49:16', 'Forgot Password', 'Contraseña olvidada', '<p><style>\n    td{\n      padding: 20px 30px 5px;\n      font-family: sans-serif;\n    }\n    thead, tbody, tfoot{\n        width: 100%;\n    }\n    table{\n      width: 100%;\n      box-shadow: 0px 0px 3px #83849B;\n    }\n    thead, tfoot{\n        height: 140px;\n        background-color: #F4F4F4;\n    }\n    span{\n        color: #30BCEF;\n    }\n    .justify{text-align: justify;}\n    .center{text-align: center;}\n    .t{color: #53c0e8;}\n    .enlaces{color: #040537;}\n</style></p>\n<div>\n    <table id=\"EmailActivationUser\">\n        <thead>\n            <tr>\n                <td>\n                    <img src=\"##SITE_URL##/assets/img/logo.png\" alt=\"##SITE_URL##\">\n                </td>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td style=\"\">\n                   <h3 class=\"t\">Estimado\\a ##USERNAME##</h3>\n                   <p>Una petición de olvido de contraseña a sido enviado desde tu cuenta en <span>##SITE_NAME##</span>.</p>\n                   <p> Nueva contraseña: <span>##PASSWORD##</span></p>\n                </td>\n          </tr>\n          <tr>\n             <td>\n                Si no solicitó esta acción y siente que esto es un error, por favor contáctenos en <span>##CONTACT_MAIL##</span>\n             </td>\n          </tr>\n            <tr>\n              <td>\n                <p class=\"justify\" style=\"font-size:0.8em\">Por favor no responder a este correo. Se envió desde un buzón desatendido y las respuestas no se revisan.</p>\n              </td>\n            </tr>\n        </tbody>\n        <tfoot>\n            <tr>\n                <td class=\"center\">\n                   <h4 class=\"t\">Gracias, <span style=\"font-size:0.6em\">##SITE_NAME## - <a class=\"enlaces\" title=\"##SITE_NAME##\" href=\"##SITE_URL##\" target=\"_blank\">##SITE_URL##</a></span></h4>\n                   <p>¿Necesitas ayuda? ¿Tienes comentarios? No dudes en <a class=\"enlaces\" title=\"Contact ##SITE_NAME##\" href=\"##CONTACT_URL##\" target=\"_blank\">Contactarnos</a></p>\n                   <img src=\"##SITE_URL##/assets/img/logo.png\" alt=\"##SITE_URL##\" width=\"160px\" height=\"40px\">\n                   <p style=\"font-size: 0.6em\">Delivered by <a class=\"enlaces\" title=\"##SITE_NAME##\" href=\"##SITE_LINK##\" target=\"_blank\">##SITE_NAME##</a></p>\n                </td>\n            </tr>\n        </tfoot>\n    </table>\n</div>\n', '', '##FROM_EMAIL##', 'we will send this mail, when user submit the forgot password form.', '##REPLY_TO_EMAIL##'),
