(10, '2016-07-02 17:32:49', '2016-07-02 17:33:30', 42, 'Terms and conditions', 'term-and-conditions', '<p>   </p><h2 class=\"post-title\">Conditions d’utilisation</h2>                                                <div class=\"post-content\">                            <p class=\"Body1\">Tout utilisateur du système mis en place par <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> a lu et approuvé les conditions suivantes :</p><p class=\"Body1\">- <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> est un site permettant de prendre rendez-vous avec un médecin généraliste ou spécialisé. En cas d’urgence, de quelle que sorte que ce soit, il est conseillé à l’utilisateur d’appeler le 112. Le site <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> n’a pas pour vocation de traiter les cas d’urgence.</p><p>– De même, le site <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> n’est pas un site prodiguant des conseils ou prescrivant des traitements en ligne. Il a pour unique vocation de permettre aux utilisateurs de déterminer une date et une heure de rendez-vous avec le médecin de leur choix, à condition que celui-ci offre la possibilité de prendre un rendez-vous en ligne.</p><p class=\"Body1\">- En vertu des règles de déontologie, le site <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a>, reprend l’ensemble des médecins officiant au Grand-Duché du Luxembourg et les présente à l’utilisateur dans un ordre alphabétique. L’utilisateur comprend que seuls les médecins participants à l’offre mise en place par <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> proposent une prise de rendez-vous en ligne. L’utilisateur et les médecins sont informés que comme tou système ionformatique<a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a>&nbsp; peut connaître des defaillances&nbsp; temporaires du service de prise de rendez-vous. Les utilisateurs et les médecins renoncent toutes poursuites contre bookmydoc en cas de défaillance technique du système.</p><p class=\"Body1\">- En ce qui concerne la mise à jour des médecins repris sur le site de <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a>, celle-ci sera effectuée ponctuellement, une fois par an. Si un médecin souhaite être intégér plus rapidement dans le répertoire du site <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a>, il est invité à envoyer un e-mail à l’adresse suivante : <a href=\"mailto:easy@bookmydoc.lu\">easy@bookmydoc.lu</a>. Les médecins sont également invités à indiquer toute modification de leurs coordonnées.</p><p class=\"Body1\">- L’utilisateur de <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> déclare être majeur. Si le rendez-vous a pour but de permettre la consultation d’un médecin par un mineur, seul un adulte responsable du-dit mineur pourra, avec son propre compte, prendre un rendez-vous à cette fin.</p><p class=\"Body1\">- Toutes les données renseignées par l’utilisateur sont cryptées.&nbsp; Le cryptage utilisé (SSL ; https://) correspond aux plus hauts standards internationaux et est conforme aux normes en vigueur au Grand-Duché du Luxembourg. Seul le médecin choisi par l’utilisateur a accès à ses données. Ce dernier s’engage à ne les utiliser qu’en vue de permettre l’établissement du dossier du patient et à les traiter selon les règles déontologiques, le principe du secret médical et les lois en vigueur au Grand-Duché de Luxembourg. Aucune tierce personne n’a accès à ces données, pour quelque raison que ce soit.</p><p class=\"Body1\">- L’utilisateur déclare être informé qu’à titre exceptionnel, pour des raisons liées à la maintenance informatique ou à la réparation de défaillances informatiques, le personnel technique de <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> peut être mis en contact avec des données confidentielles. L’utilisateur est informé que ce-dit personnel s’engage à respecter le secret professionnel et n’utilisera pas ni ne divulguera les informations confidentielles avec lesquelles il a été mis en contact et ce, pour quelque raison que ce soit.</p><p class=\"Body1\">- L’utilisateur s’engage à fournir en toute bonne foi son identité, ses coordonnées et les renseignements demandés lors d’une prise de rendez-vous en ligne. En les fournissant, il déclare sur l’honneur que les informations qu’il donne sont exactes, réelles et sincères. L’utilisateur déclare être informé que l’utilisation d’une fausse identité et de fausses informations peut donner lieu à des poursuites judiciaires.</p><p class=\"Body1\">- Les médecins offrant une prise de rendez-vous en ligne sont responsables de leur agenda. <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> ne saurait être tenu pour responsable de leur utilisation des outils mis à leur disposition grâce au système bookmydoc.</p><p class=\"Body1\">- L’utilisateur, ainsi que les médecins proposant une prise de rendez-vous en ligne, sont informés que tout système informatique peut connaître des défaillances. Ainsi,&nbsp;<a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> ne saurait être tenu pour responsable d’une défaillance informatique – que celle-ci survienne, entre autres, au niveau de l’utilisation des services proposés, de l’hébergement du site internet, de l’ordinateur du ou des médecins. Par conséquent,&nbsp;<a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a> ne peut souffrir d’un défaut de paiement ou être mis en demeure de rembourser des frais quelconques sur base de ce motif. Cependant, <a href=\"http://www.bookmydoc.lu/\">www.bookmydoc.lu</a>met tout en oeuvre pour pouvoir offrir à ses utilisateurs un service de qualité et, en cas de défaillance(s) technique(s), veillera à les résoudre rapidement.</p><p class=\"Body1\">- En cas de litige, seuls le droit et les tribunaux luxembourgeois sont jugés compétents. La nullité d’une des clauses susmentionnées est sans effet sur la validité des autres clauses de ces Conditions générales d’utilisation.</p><p class=\"Body1\">- Pour toute question ou renseignement supplémentaire, veuillez adresser un e-mail à&nbsp;<a href=\"mailto:easy@bookmydoc.lu\">easy@bookmydoc.lu</a>.</p><p class=\"Body1\">- En utilisatnt bookmydoc.lu , l’utilisateur reconnaît avoir lu et approuvé l’ensemble de ces Conditions générales d’utilisation. En cas de modification ou de mise à jour des présentes Conditions générales d’utilisation, il est tenu pour acquis que l’utilisateur a en pris connaissance et les a acceptées lorsqu’il effectue, sur le site www.bookmydoc.lu, une connexion postérieure à ces changements.</p><p>Bookmydoc par Groupe Eugène SARL<br>243, avenue G. Diderich<br>L-1420 Luxembourg<br><a href=\"mailto:easy@bookmydoc.lu\">easy@bookmydoc.lu</a></p></div><p></p>', 0),
