INSERT INTO `sms_templates` (`id`, `created_at`, `updated_at`, `name`, `description`, `sms_content`, `sms_variables`) VALUES
(1, '2012-11-18 18:30:00', '2012-12-02 06:50:43', 'Mobile Verification for Patient Registration', 'we will send this message via SMS, when\r\nuser register the site for mobile verificaton form.', 'Your code is ##OTP##. This code is used to confirm registration ##SITE_NAME##. With this code do not share anyone. Thank You, ##SITE_NAME## team.', 'OTP,SITE_NAME'),
(2, '2012-11-18 18:30:00', '2013-02-09 11:24:16', 'Patient New Appointment Request', 'we will send this message via SMS, when\r\nuser requesting the Doctor Appointment.', 'Dear ##USERNAME##, We have received your request. Wait for Dokora if your reservation confirmed. Thank You, ##SITE_NAME## team.', 'USERNAME,SITE_NAME'),
(3, '2012-11-18 18:30:00', '2016-08-11 11:12:39', 'Alert New Appointment Request to Doctor', 'we will send this message via SMS, when\r\npatient requesting the Doctor Appointment Alert.', '<p>Dear ##DOCTOR_USERNAME##, created reservation. Please look at your schedule and confirm or cancel the appointment.  Thank You, ##SITE_NAME## team.</p>', 'DOCTOR_USERNAME,USERNAME,SITE_NAME'),
(4, '2012-11-18 18:30:00', '2013-02-09 11:23:49', 'Alert Doctor Appointment Approved to Patient', 'we will send this message via SMS, when\r\ndoctor approved that patient appointment.', 'Dear ##USERNAME##, physician received and approved your desired appointment. Thank You, ##SITE_NAME team.', 'USERNAME,SITE_NAME'),
(5, '2012-11-18 18:30:00', '2013-02-09 11:23:20', 'Alert Doctor Appointment Declined to Patient', 'we will send this message via SMS, when\r\ndoctor declined that patient appointment.', 'Dear ##USERNAME##, We have received your request to reserve the term. The term was rejected by a doctor. Within 24 h, you should have a doctor give a reason. Thank you for your understanding. Thank You, ##SITE_NAME team.', 'USERNAME,SITE_NAME'),
(6, '2012-11-18 18:30:00', '2013-02-09 11:22:51', 'Alert Doctor Appointment Canceled to Patient', 'we will send this message via SMS, when\r\ndoctor canceled that patient appointment.', 'Dear ##USERNAME##, doctor canceled your reservation request. Doctor you as soon as possible, state the reasons. Thank you for your understanding. Thank You, ##SITE_NAME## team.', 'USERNAME,SITE_NAME');
