(3, '2016-05-24 05:12:32', '2017-03-30 15:58:05', 3, 'John', 'Smith', 'Dr', 'Family Physician', '', '1,2,3', '5,6', '42,9,69', NULL, 1, '2017-01-15', '9655330518', '26 70 18 16', NULL, NULL, 'Medical School - Ross University School of Medicine\r\nSouth Nassau Communities Hospital, Residency in Family Medicine', 'American Board of Family Medicine', '53 Rue Principale', 'amily medicine doctor practicing in New York, New York. Dr. Eidgah is affiliated with multiple hospitals in the area, including Mount Sinai Beth Israel and New York Eye and Ear Infirmary of Mount Sinai.\r\nDr. Eidgah treats multiple medical problems including anxiety, depression, ADD, ADHD, STD\'s, hypertension, diabetes, lipids and many other conditions. He prides himself on offering exceptional care.', 19, 0, 129, '600034', 1, 0, 1, 0, 'American Academy of Family Physicians', 0, -73.9831678, 0, '123456789011', 10, '', '<div class=\"doc-descrip\"><figure><img src=\"assets/img/doctor-description.jpg\" alt=\"doctor-description\" class=\"img-responsive\"/><figcaption class=\"ng-binding\">Servicio Odontológico Integral</figcaption></figure><h3 class=\"ng-binding\">Limpieza bucal con fluorización, revisión y diagnóstico con radiografía</h3><p class=\"ng-binding\">¿Sabías qué un cepillado después de cada comida, una visita periódica al dentista, una limpieza bucal… son algunos de los elementos claves para garantizar una buena higiene bucal?</p><ul class=\"list-inline row\"><li class=\"col-sm-4\"><figure><img src=\"assets/img/description-one.jpg\" alt=\"description-one\" class=\"img-responsive\"/></figure></li><li class=\"col-sm-4\"><figure><img src=\"assets/img/description-two.jpg\" alt=\"description-two\" class=\"img-responsive\"/></figure></li><li class=\"col-sm-4\"><figure><img src=\"assets/img/description-three.jpg\" alt=\"description-three\" class=\"img-responsive\"/></figure></li></ul><p class=\"ng-binding\">Ofrece los últimos tratamientos en estética dental y ortodoncia invisible. Disponen de servicio de radiología para evitar traslados a otros centros y un equipo de odontólogos multidisciplinar e internacional.</p></div>', 'Dr John Smith', '', '', '', 'NaN,3,8,6', 'NaN,3,1', 'Advantage Health,Aetna', '42', NULL),
