(19, '2016-08-10 15:11:39', '2017-02-24 18:11:45', 23, 'Rolando', 'Toyos', 'Dr.Toyos', 'Clinic', '', '11', NULL, '0,186,185,182,179,173,167,168,171,174,177,184,175,172,163,162,161', NULL, 1, '0000-00-00', '5462124528', NULL, NULL, NULL, 'IMPORTANT:\r\nMake sure that you have all the information required on this form when you begin. Once you have completed and submitted the information, you will not be able to change any of the details.\r\n\r\nMake sure that you do the Online Payment within half an hour. If the time limit exceeds, the Invoice Number will be allotted to some other Patients.\r\n\r\nThe information that you fill in here will be submitted to CMC Vellore.\r\nGeneral instructions to book New appointments online:\r\nOn clicking “Click here to register Online” icon, you are directed to page where personal & residence details of the patient has to be filled in.\r\n\r\nOn submitting the filled in form, the transaction number, Bill number & Invoice number will be generated, which has to be noted down for future reference.\r\n\r\nThen you will be requested to select the appointment category (General or Private).\r\nIf a Private doctor is chosen then, select the doctor you would prefer to consult along with the appointment date and payment mode.\r\n\r\nYou will be directed to HDFC payment site. There you will have to enter the required payment information.\r\n\r\nIn case of failure, the slot will be available for the next 30 minutes for you to retry.\r\n\r\nOn successful completion of the payment, the system will allow you to take a print out of the appointment.\r\nA message to the specified mobile number and a mail to the specified mail ID will be sent.\r\n\r\nIn case of payment failure, where the money gets deducted but the appointment site closes or no information is displayed, \r\nthen you can login using the transaction number and random sequence number to get a print out.\r\n\r\nIf the slot is allotted to another patient, the system will check and refund back the money automatically after 20 minutes.\r\n\r\nIn case you find after a confirmed payment the appointment slot has not been allotted, \r\nthe system will automatically allot the slot and sends the message and the email.\r\n\r\nThe patient can login to take the required printout.\r\n\r\nRefunds for appointments booked online will not be made.\r\n\r\nUnit change is not allowed', 'American Board of Ophthalmology', '3443 Dickerson Pike\r\nNashville, TN 37207', 'Rolando Toyos, M.D. is the Medical Director and Founder of Toyos Clinic. Dr. Toyos is originally from California. He graduated from Santa Rosa High School where he played Varsity Basketball, Baseball and Football and was a finalist for the CIF Scholar-Athlete of the Year Award. He received his Bachelors and Masters degrees from The University of California, Berkeley and Stanford University, where he was a straight A student. Before beginning medical school, Dr. Toyos worked as a high school teacher and basketball coach. He won the National Teaching Award from Columbia University for his science curriculum development and his work with at-risk children. He then received his medical degree at the University of Illinois where he was Class President, graduating with James Scholar Academic Honors and received a community service award for helping Chicago City Public Schools develop a pre-med program for students interested in medicine. He completed his internship in Internal Medicine at Illinois Masonic Hospital in Chicago. He completed his Ophthalmology residency at Northwestern University and Chicago Children\'s Hospital. Dr. Toyos spent one year performing LASIK at the Assil Eye Institute in Beverly Hills.', 17, 0, 253, '64014', 1, 0, 1, 1, '\"Complete your forms online with this practice\"', 0, -86.7503639, 0, NULL, NULL, '', '', 'Dr.Toyos Rolando Toyos', '', '', '', '', '', NULL, '', NULL),
(20, '2016-08-10 15:17:17', '2017-02-24 18:11:45', 24, 'Jay', 'Yoon', 'Dr', 'Cohen\'s Fashion Optical', '', '11', NULL, '0', NULL, 2, '0000-00-00', '9876543210', NULL, NULL, NULL, 'I\'m a Doctor', 'null', '385 Fifth Avenue\r\nNew York, NY 10016', 'Dr. Jay Yoon is a contact lens specialist who has been practicing in New York City for seven years; she has an expertise in challenging contact lens fittings including Rigid Gas Permeable lenses, Multifocal, and Keratoconus. She performs comprehensive eye exams including emergency red eye conditions and pre- and post-LASIK care.\r\n\r\nDr. Yoon has built a well-respected practice focusing on long term vision and eye health with a strong network of referral specialists. Dr. Yoon earned her BA at New York University in 2004 and graduated from State University of New York, State College of Optometry in 2009.', 12, 0, 253, '10016', 1, 0, 1, 1, 'null', 0, -73.9833789, 0, NULL, NULL, '', '', 'Dr Jay Yoon', '', '', '', '', '', NULL, '', NULL),
